package dev.yafatek.models;import java.util.List;public class CustomerModel {	private Integer customerId;	private String firstName;	private String lastName;	private String phoneNumber;	private String telephone;	private String birthday;	private String extraInfo;	private List<CustomerAddress> customerAddresses;	public CustomerModel(Integer customerId, String firstName, String lastName, String phoneNumber, String telephone, String birthday, String extraInfo, List<CustomerAddress> customerAddresses) {		this.customerId = customerId;		this.firstName = firstName;		this.lastName = lastName;		this.phoneNumber = phoneNumber;		this.telephone = telephone;		this.birthday = birthday;		this.extraInfo = extraInfo;		this.customerAddresses = customerAddresses;	}	public CustomerModel() {	}	public Integer getCustomerId() {		return customerId;	}	public void setCustomerId(Integer customerId) {		this.customerId = customerId;	}	public String getFirstName() {		return firstName;	}	public void setFirstName(String firstName) {		this.firstName = firstName;	}	public String getLastName() {		return lastName;	}	public void setLastName(String lastName) {		this.lastName = lastName;	}	public String getPhoneNumber() {		return phoneNumber;	}	public void setPhoneNumber(String phoneNumber) {		this.phoneNumber = phoneNumber;	}	public String getTelephone() {		return telephone;	}	public void setTelephone(String telephone) {		this.telephone = telephone;	}	public String getBirthday() {		return birthday;	}	public void setBirthday(String birthday) {		this.birthday = birthday;	}	public String getExtraInfo() {		return extraInfo;	}	public void setExtraInfo(String extraInfo) {		this.extraInfo = extraInfo;	}	public List<CustomerAddress> getCustomerAddresses() {		return customerAddresses;	}	public void setCustomerAddresses(List<CustomerAddress> customerAddresses) {		this.customerAddresses = customerAddresses;	}}